import React from 'react'
import './style.css';

function SearchLanguage() {
    return (
        <div class="search-language-container">
            <div class="search-language">
                Google offered in:  
                <a hrefe="#" alt="Espanol" >
                    Español (Latinoamérica)
                </a>
            </div>
        </div>
    )
}

export default SearchLanguage
